oFF.FdContentProviderHierarchyCatalog.prototype.m_allItems = null;
oFF.FdContentProviderHierarchyCatalog.prototype.m_catalogManager = null;
oFF.FdContentProviderHierarchyCatalog.prototype.m_dimension = null;
