{
	let label = genesis.newControl(oFF.UiType.LABEL);
	label.setName(labelText);
	label.setText(labelText);
	label.setWidth(oFF.UiCssLength.create("40%"));
	label.setTextAlign(oFF.UiTextAlign.RIGHT);
	return label;
};
