	if (oFF.isNull(presentation))
	{
		return null;
	}
	if (this.isNull())
	{
		return oFF.XLocalizationCenter.getCenter().getText(oFF.FilterDialogI18n.I18N_FD_NULL);
	}
	let value = presentation.isKey() ? this.getDisplayKey() : this.getText();
