	this.m_mainView = oFF.XObjectExt.release(this.m_mainView);
	this.m_searchLayout = oFF.XObjectExt.release(this.m_searchLayout);
	this.m_togglesLayout = oFF.XObjectExt.release(this.m_togglesLayout);
