		requiredDimLabel.setFontWeight(oFF.UiFontWeight.BOLD);
		this.m_dimContextInfoText = oFF.XStringUtils.concatenate3(this.m_dimContextInfoText, requiredDimInfoLabel.getText(), requiredDimLabel.getText());
