	this.m_mainLayout = genesis.newControl(oFF.UiType.FLEX_LAYOUT).setDirection(oFF.UiFlexDirection.COLUMN).setPadding(oFF.UiCssBoxEdges.create("0.5rem 1rem"));
	this._buildLayoutUi();
